function importLevel(str) {
	try {
		const json = JSON.parse(str);
		if (json.version !== 2) {
			level.blocks = json.blocks || [];
			level.spikes = json.spikes || [];
		} else {
			if (!json.k) json.k = ["x", "y", "width", "height", "type", "rotation", "hitbox"];

			level.blocks = [];
			level.spikes = [];

			for (let i = 0; i < json.blocks.length; i++) {
				const obj = {};
				for (let j = 0; j < json.k.length; j++) {
					obj[json.k[j]] = json.blocks[i][j];
				}
				level.blocks.push(obj);
			}

			for (let i = 0; i < json.spikes.length; i++) {
				const obj = {};
				for (let j = 0; j < json.k.length; j++) {
					obj[json.k[j]] = json.spikes[i][j];
				}
				level.spikes.push(obj);
			}
		}
	} catch (err) {
		console.error(err);
		showDevMessage(err, 2);
	}
}

function exportLevel() {
	const obj = {
		version: 2,
		k: ["x", "y", "width", "height", "type", "rotation", "hitbox"],
		blocks: [],
		spikes: []
	};

	for (let i = 0; i < level.blocks.length; i++) {
		const b = level.blocks[i];
		obj.blocks.push([b.x, b.y, b.width, b.height, b.type, b.rotation, b.hitbox !== undefined ? b.hitbox : true]);
	}

	for (let i = 0; i < level.spikes.length; i++) {
		const s = level.spikes[i];
		obj.spikes.push([s.x, s.y, s.width, s.height, s.type, s.rotation, s.hitbox !== undefined ? s.hitbox : true]);
	}

	const json = JSON.stringify(obj);
	showDevMessage(json, 1);
}